class widgetImagesComparison extends elementorModules.frontend.handlers.Base{getDefaultSettings(){return{selectors:{target:".images-comparison"}}}getDefaultElements(){const e=this.getSettings("selectors");let t={$target:this.$element.find(e.target),settings:this.$element.find(e.target).data("settings")||{},leftTitle:"",rightTitle:""};return t.leftTitle=t.settings.data_title_left,t.rightTitle=t.settings.data_title_right,t}onInit(){super.onInit(),this.elements.$target.imagesLoaded().always((()=>{jQuery(this.elements.settings.data_diff).simpleImageDiff({titles:{before:this.elements.leftTitle,after:this.elements.rightTitle}})}))}}jQuery(window).on("elementor/frontend/init",(()=>{elementorFrontend.elementsHandler.attachHandler("eac-addon-images-comparison",widgetImagesComparison)}));